            </div>

            <div id='features'>
            <div className='a-container'>
                <WellnessTips tips={wellnessTips} title='Examples:'/>
                <FeatureBox image={featureimage1} title='Examples:'/>
                <FeatureBox image={featureimage2} title='Examples:'/>
            </div>
        </div>
          </>
    )
}

export default Presentation;
